;; gorilla-repl.fileformat = 1

;; **
;;; # Gaussian mixture model: Iris data
;;; 
;;; Let's experiment with implementing a Gaussian mixture model in Anglican.
;; **

;; @@
(ns gmm-iris
  (:use [mrepl core]
        [embang emit runtime])
  (:require [gorilla-plot.core :as plot]
            [clojure.data.csv :as csv]
            [clojure.java.io :as io]
            [clojure.core.matrix :as m]
            [clojure.core.matrix.operators :as op]
            [clojure.core.matrix.linear :as linalg]))

(m/set-current-implementation :vectorz)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-keyword'>:vectorz</span>","value":":vectorz"}
;; <=

;; **
;;; Let's read in the Iris data set from its CSV file:
;; **

;; @@
(def iris-data
  (loop [X []
         y []
         data (with-open [file (io/reader "data/iris.csv")]
                (doall (csv/read-csv file)))]
    (def row (first data))
    (if (nil? row)
      [(m/matrix X) y]
      (recur (conj X (map #(Float/parseFloat %) (take 4 row)))
             (conj y (keyword (peek row)))
             (rest data)))))

(def X (get iris-data 0))
(def y (get iris-data 1))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gmm-iris/y</span>","value":"#'gmm-iris/y"}
;; <=

;; **
;;; Let's plot it. It's 4-dimensional. We use PCA to project it down into 2 for visualization purposes.
;;; 
;;; These are maybe useful functions for plotting labelled data, in general?
;; **

;; @@
(def label-indices (apply zipmap ((fn [v] [(into () v) (range (count v))]) (into #{} y))))
(def colors ["#34C6F2" "#64F54A" "#F13F6F" "#E4AEFB" "#253B3E" 
             "#8B5904" "#BBC324" "#EAC092" "#360A07" "#0888A4"])
(defn get-color [label]
  (get colors (label label-indices)))

(defn plot-2d [data labels color-fn & [jitter & options]]
  "plotting function that plots the first two dimensions of the provided data"
  (reduce plot/compose
          (cons
            (plot/list-plot (map #(take 2 %) data) :color "#ffffff")
            (for [i (range (count labels))]
              (let [point (take 2 (m/get-row data i))
                    label (get labels i)
                    color (color-fn label)
                    point (if jitter
                            (op/+ point (op/* jitter (sample (mvn [0. 0.] (m/identity-matrix 2)))))
                            point)]
                (plot/list-plot [point] :color color :symbol-size 20))))))

(defn plot-pca [data labels color-fn]
  "plotting function that takes high-dimensional data and projects into 2d for visualzation"
  (let [projection (m/transpose (m/select (:V* (linalg/svd X {:return [:V*]})) [1 0] :all))
        data (m/mmul X projection)]
    (plot-2d data labels color-fn)))
    
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gmm-iris/plot-pca</span>","value":"#'gmm-iris/plot-pca"}
;; <=

;; **
;;; Compare the two resulting plots below. The first plots the first two dimensions; the second plots the data projected onto the first two principal components.
;; **

;; @@
(plot-2d X y get-color 0.01)
(plot-pca X y get-color)
